highlowApp.heatmap={init:function(){$(".heatmap").on("click",".expander",function(){var a=$($(this).closest(".heatmap")),t=$("#"+a.data("target"));if(a.hasClass("collapsed")){a.removeClass("collapsed"),t.animate({left:"50px"},150),$(".trading-platform-live-graph").addClass("pushed");var e=$(a.closest(".main-view")).data(highlowApp.marketSimulator.modelDataName);highlowApp.graph.loadInstrument(e)}}),$(".heatmap").on("click",".toggle",function(){var a=$($(this).closest(".heatmap")),t=$("#"+a.data("target"));if(!a.hasClass("collapsed")){a.addClass("collapsed"),t.animate({left:"0px"},150),$(".trading-platform-live-graph").removeClass("pushed");var e=$(a.closest(".main-view")).data(highlowApp.marketSimulator.modelDataName);highlowApp.graph.loadInstrument(e)}})}};